import Cell from "./Cell";

export default class Grid {
    rows: number;
    columns: number;
    grid: Cell[][];
    start: Cell;
    end: Cell;

    constructor(rows: number, columns: number) {
        this.rows = rows;
        this.columns = columns;
        this.grid = [];
        this.start = new Cell();
        this.end = new Cell();
    }
}
